import NavLink from './nav-link';

this.state = { isOn : 'home' }

const links = [
  {
    title: 'bit lore',
    path: ''
  },
  {
    title: 'about',
    path: 'about'
  },
  {
    title: 'work',
    path: 'work'
  },
  {
    title: 'contact',
    path: 'contact'
  }
];

const navItems = links.map( link => NavLink(link) );

const Header = () => (


  <nav>
    <NavLink title="bitlore" path="" on="true"/>
    <NavLink title="about" path="about" on="false"/>
    <NavLink title="work" path="work" on="false"/>
    <NavLink title="contact" path="contact" on="false"/>
    <style jsx>{`
      nav {
      	display: flex;
      	justify-content: space-between;
      	margin: 0 auto;
      	height: 2em;
      	line-height: 2em;
      }

      @media only screen and (max-width:600px) {
      	nav {
      		text-align: center;
      	}
      }
    `}</style>
  </nav>
);

export default Header;
